import {Routes, Route, useNavigate} from 'react-router-dom';
import logo from './logo.svg';
import gcmateLogo from './img/GCMateIcon.png';
import './App.css';

function App() {
  

  
  return (
    <div 
      className="App"
      style={{
        backgroundImage: 'url('+gcmateLogo+')',
        backgroundSize: "cover",
        height: "110vh"
      }}>
      <h2> Top Text </h2>
    </div>
  );
}

export default App;
